import React from 'react';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';
import Chat from './Chat';

function App() {
  const currentPath = window.location.pathname;

  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/chat">Chat</Link>
            </li>
            {/* Other links */}
          </ul>
        </nav>

        {currentPath === '/chat' && <Chat />}
      </div>
    </Router>
  );
}

export default App;
